import React from "react";
import styled from "styled-components";
export default function DepositPage() {
  return (
    <>
      const StyledHeader = styled.div` width: 370px; height: 60px; display:
      flex; align-items: flex-start; justify-content: space-between;
      font-weight: 700; font-size: 28px; margin: 20px 0; `;
    </>
  );
}
